function $te(a){YFe(a.k,'This module teaches how IEEE floats are stored in binary.');YFe(a.k,"We're going to be working with a 16 bit numbers...");YFe(a.k,'... but the process is the same for 32bit and 64bit numbers.');YFe(a.k,wpf);YFe(a.k,xpf);YFe(a.k,"Let's figure out how to store the number below.");YFe(a.k,'The first step is to convert the number to plain old binary.');YFe(a.k,'The easiest way to do this, is to separate our number into two parts.');YFe(a.k,'The first part is the whole number portion(left of the decimal point).');YFe(a.k,'The second part is the fractional portion; (right of the decimal point).');YFe(a.k,'We can convert the whole number part by repeatedly dividing by 2!');YFe(a.k,'Everytime we get a remainder, the remainder becomes a digit!');YFe(a.k,'So, we just repeatedly divide our result by 2, and record the remainders.');YFe(a.k,'Eventually, we get zero as a result (and we stop our divisions)');YFe(a.k,"An example will make this clearer, let's work it out.");YFe(a.k,"When you see a flashing '|' cursor, type the answer.");YFe(a.k,ypf);YFe(a.k,'Fill in the answers, or press enter to see the correct value.');YFe(a.k,'Note: each division builds the binary number in reverse...');YFe(a.k,"...that's why we wrote our divisions backwards (right to left)...");YFe(a.k,'... doing the divisions right to left makes it easier to read.');YFe(a.k,'Now, the red remainders represent the whole number portion in binary.');YFe(a.k,'Next, we need to convert the numbers to the right of the decimal point');YFe(a.k,'The fractional portion is converted by a series of multiplications');YFe(a.k,'So, instead of dividing, we multiply our fractional portion by 2 ...');YFe(a.k,"...the result's *whole* number portion tells us a digit");YFe(a.k,"That is, if '0' is to the left of the decimal, then the next binary digit is 0.");YFe(a.k,"If a '1' is to the left of the decimal, then the next binary digit is 1!");YFe(a.k,'Just like in the previous dividing steps, we keep multiplying to get more digits!');YFe(a.k,'One small note though...');YFe(a.k,'if we get a 1, then we must subtact 1 before the next multiplication...');YFe(a.k,"...don't worry, that will become clear with the example.");YFe(a.k,"Now let's get started with the fractional part...");YFe(a.k,zpf);YFe(a.k,'Keep multiplying the numbers until we get zero, or run out of space.');YFe(a.k,'We ran out of space... this may be a repeating number in binary!');YFe(a.k,'Some numbers repeat in binary, like 1/3 (0.333) does in decimal.');YFe(a.k,'If a number is repeating, we store as many digits as we can.');YFe(a.k,"Back to the task, IEEE floats don't store converted number directly...");YFe(a.k,'... to store the number we need to first convert it to scientific notation.');YFe(a.k,'Before I explain this, there is a slight change in language I need to explain.');YFe(a.k,"When we're dealing with decimal numbers, we call the ' . ' a 'decimal point'.");YFe(a.k,"When we're dealing with binary numbers, we could the ' . ' a 'binary point'.");YFe(a.k,"In a more general sense, we could just call the ' . ' a 'radex point'");YFe(a.k,"However, I'm going to keep refering to the ' . ' as a decimal point, regardless of our base.");YFe(a.k,'Now then, to convert our number to scientific notation!');YFe(a.k,'Just like in decimal scientific notation, we move the decimal point.');YFe(a.k,'Normally, every time we move decimal point, we have to multiply by a power of 10.');YFe(a.k,'But in binary, we multiply by a power of 2 -- instead of 10.');YFe(a.k,Apf);YFe(a.k,'Press enter move the decimal point, notice the change in power of 2.');YFe(a.k,"Now we're almost done, but not quite...");YFe(a.k,"...IEEE doesn't directly store the scientific notation...");YFe(a.k,'...it stores other data too, such as positive/negative bit and the exponent of 2.');YFe(a.k,Bpf);YFe(a.k,'The IEEE floating point is broken up into 3 pieces.');YFe(a.k,'it consists of,  1 sign bit, 5 exponent bits, and 10 Mantissa bits.');YFe(a.k,'The 01111 is related to the exponent, but we will get to that in a moment.');YFe(a.k,'The mantissa is where we store the scientific notation number.');YFe(a.k,'The mantissa is the right hand 10 bits, colored purple.');YFe(a.k,'Press enter to move our binary number to the final conversion.');YFe(a.k,Cpf);YFe(a.k,'If we have any extra bits, we pad them with zeros.');YFe(a.k,'You may have noticed that we did not store the whole number before the decimal.');YFe(a.k,'This is actually a space saving mechanism');YFe(a.k,'Remember, in binary digits are either 0 and 1...');YFe(a.k,'...if digit left of the decimal place were 0, it would be invalid scientific notation...');YFe(a.k,"That is, we don't write '0.11 x 2^2', instead we write '1.1 x 2^1'");YFe(a.k,'This is because in scientific notation we only have a single digit whole number portion.');YFe(a.k,'So, the leftmost digit must be 1, since there are no other characters in binary.');YFe(a.k,'Thus, we can save one bit by not including the first 1 in our conversion!');YFe(a.k,"Now, let's store the exponent of the 2");YFe(a.k,'Because we can have positive or negative exponents... ');YFe(a.k,"...we won't store the exponent directly.");YFe(a.k,"Instead of directly using 2s complement, IEEE uses a 'bias' value.");YFe(a.k,'This bias value is 01111 for 16 bits.');YFe(a.k,'Now, 01111 is basically an unsigned value that represents a 0 exponent.');YFe(a.k,'So, if 01111 is in our exponent bits, then we have a 0 exponent');YFe(a.k,Dpf);YFe(a.k,'The next step is to add our exponent to this 01111 bias.');YFe(a.k,'As a result, positive exponents add and become larger than the 01111...');YFe(a.k,'...and negative exponents add to 01111 and become smaller than the 01111!');YFe(a.k,'This is how we can store negative and positive exponents!');YFe(a.k,Epf);YFe(a.k,'Now, add together our exponent with the bias value.');YFe(a.k,Fpf);YFe(a.k,'The last thing we need to do is store the sign of the converted value.');YFe(a.k,'We simply store a 0 for positive numbers, and a 1 for negative numbers.');YFe(a.k,'Since our value is positive, the first bit becomes a 0.');YFe(a.k,Gpf);YFe(a.k,"And that is it, we're done converting the number!");YFe(a.k,'You can press spacebar at any time to see the available keybinds.');YFe(a.k,'At anytime you get stuck, simply press enter to see the next step.');YFe(a.k,'You may want to first have the computer walk you through a few.');YFe(a.k,'But do try and solve some yourself. :)');YFe(a.k,'Press n to randomly generate a new problem for practice.')}
